(function () {
    'use strict';

    angular.module('main').directive('chatBox', DirectiveFn);

    /**
     * Directive
     *
     * @returns {{restrict: string, scope: {}, bindToController: boolean, controller: ControllerFn, controllerAs: string, templateUrl: string}}
     * @constructor
     */
    function DirectiveFn() {

        return {
            restrict: "EA",
            scope: {
                color: "@",
                data: "="
            },
            bindToController: true,
            link: linkFn,
            controller: ControllerFn,
            controllerAs: "vmChat",
            templateUrl: "app/modules/widgets/chat-box/chat-box.html"
        };

    }

    /**
     * Link
     * @param scope
     * @param elem
     * @param attr
     */
    function linkFn(scope, elem, attr) {
        scope.bodyId = attr.id + "-body";
        // SLIMSCROLL FOR CHAT WIDGET
        window.setTimeout(function () {
            $('#' + scope.bodyId).slimScroll({
                height: '250px',
                start: "bottom"
            });
        }, 250);
    }

    /**
     * Controller Function
     *
     * @constructor
     */
    function ControllerFn() {
        var vm = this;

        vm.message = "";

        vm.send = sendFn;

        /**
         * Sends new message
         */
        function sendFn() {
            if (vm.message !== "") {
                vm.data.chat.push({
                    user: "user1",
                    time: "8:15",
                    message: vm.message,
                    attachment: null
                });
                vm.message = "";
            }
        }
    }
})();

(function () {
    'use strict';

    angular.module('main').directive('dateRangePicker', DirectiveFn);

    /**
     * Directive
     *
     * @returns {{restrict: string, scope: {date: string}, link: linkFn}}
     * @constructor
     */
    function DirectiveFn() {

        return {
            restrict: "EA",
            scope: {
                date: "="
            },
            link: linkFn
        };

    }

    function linkFn($scope, $element, $attrs)  {
        $($element).daterangepicker({
            ranges: {
                'Today': [moment(), moment()],
                'Yesterday': [moment().subtract(1, 'days'), moment().subtract(1, 'days')],
                'Last 7 Days': [moment().subtract(6, 'days'), moment()],
                'Last 30 Days': [moment().subtract(29, 'days'), moment()],
                'This Month': [moment().startOf('month'), moment().endOf('month')],
                'Last Month': [moment().subtract(1, 'month').startOf('month'), moment().subtract(1, 'month').endOf('month')]
            },
            startDate: moment().subtract(29, 'days'),
            endDate: moment()
        }, function (start, end) {
            $scope.date = start.format('MMMM D, YYYY') + ' - ' + end.format('MMMM D, YYYY');
            console.log('You chose: ' + start.format('MMMM D, YYYY') + ' - ' + end.format('MMMM D, YYYY'));
        });
    }
})();

