(function () {
    'use strict';

    angular.module('main').directive('knob', DirectiveFn);

    /**
     * Directive
     *
     * @returns {{restrict: string, scope: {data: string}, link: linkFn}}
     * @constructor
     */
    function DirectiveFn() {

        return {
            restrict: "A",
            require: '^ngModel',
            scope: {
                knobOptions: "=",
                ngModel: "="
            },
            link: linkFn
        };

    }

    /**
     * Link
     * @param $scope
     * @param $element
     * @param $attrs
     * @param $ctrl
     */
    function linkFn($scope, $element, $attrs, $ctrl)  {

        window.setTimeout(function () {
            var options = angular.copy($scope.knobOptions);

            options.release = function (v) {
                $scope.$apply(function () {
                    $ctrl.$setViewValue(v);
                });
            };

            /* jQueryKnob */
            $('#' + $attrs.id).knob(options);
        }, 250);
    }
})();

(function () {
    'use strict';

    angular.module('main').directive('morrisChart', DirectiveFn);

    /**
     * Directive
     * @returns {{restrict: string, $scope: {type: string, data: string}, bindToController: boolean, link: linkFn}}
     * @constructor
     */
    function DirectiveFn() {

        return {
            restrict: "E",
            scope: {
                type: "@",
                redraw: "@",
                data: "="
            },
            link: linkFn
        };

    }

    /**
     * Link Function
     * @param $scope
     * @param $element
     * @param $attrs
     */
    function linkFn($scope, $element, $attrs)  {
        var chart;

        $(document).ready(function () {
            if ($scope.type == "line") {
                chart = new Morris.Line($scope.data);
            } else if ($scope.type == "donut") {
                chart = new Morris.Donut($scope.data);
            } else if ($scope.type == "bar") {
                chart = new Morris.Bar($scope.data);
            } else {
                chart = new Morris.Area($scope.data);
            }
        });

        $scope.$watch("redraw", function (newVal) {
            if ($scope.redraw) {
                window.setTimeout(function () {
                    chart.redraw();
                }, 250);
            }
        })
    }
})();

